import React, { Component } from 'react';
import { Card, Icon } from 'semantic-ui-react'
// import './test_tweet.json'
import testTweet from './testTweet'

class Test extends Component {
  constructor(props) {
    super(props);

    if (testTweet.entities.urls.length == 0) {
      this.state = {
        id: testTweet.id,
        url: null,
        text: testTweet.text,
        userName: testTweet.user.name
      }
    }
    else {
      this.state = {
        id: testTweet.id,
        url: testTweet.entities.urls.url
      };
    }
  }

  render() {
    return (
      <Card>
        <Card.Content header={this.state.userName} />
        <Card.Content description={this.state.text} />
        <Card.Content extra>
          <Icon name='user' />
          4 Friends
        </Card.Content>
      </Card>
    );
  }
}


export default Test;
